// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

import "./LandStructs.sol";
import "./LandModifiers.sol";

contract LandRegistry is LandModifiers {
    uint256 public landCounter;
    mapping(uint256 => OwnershipHistory) internal landHistory;
    mapping(uint256 => Dispute[]) internal landDisputes;
    mapping(address => uint256[]) public ownerToLands;

    event LandRegistered(uint256 indexed landId, address indexed owner);
    event OwnershipTransferred(uint256 indexed landId, address indexed from, address indexed to);
    event LandValuationUpdated(uint256 indexed landId, uint256 newValuation);
    event LandStatusChanged(uint256 indexed landId, string newStatus);
    event DocumentAdded(uint256 indexed landId, string documentHash);
    event LandVerified(uint256 indexed landId, address indexed verifier);
    event DisputeRaised(uint256 indexed landId, address indexed complainant);
    event DisputeResolved(uint256 indexed landId, address indexed resolver);
    event DocumentRemoved(uint256 indexed landId, string documentHash);
    event SaleStatusReverted(uint256 indexed landId);

    constructor() {
        _initializeVerifier(msg.sender);
    }

    function registerLand(string memory _location, uint256 _area) external {
        landCounter++;
        address[] memory initialOwners = new address[](1);
        initialOwners[0] = msg.sender;
        
        lands[landCounter] = Land({
            id: landCounter,
            location: _location,
            area: _area,
            owners: initialOwners,
            isRegistered: true,
            valuation: 0,
            isForSale: false,
            price: 0,
            status: "Registered",
            documents: new string[](0),
            isVerified: false,
            verifiedBy: address(0),
            verificationDate: 0
        });

        landHistory[landCounter] = OwnershipHistory({
            previousOwners: initialOwners,
            transferDates: new uint256[](1)
        });
        landHistory[landCounter].transferDates[0] = block.timestamp;

        ownerToLands[msg.sender].push(landCounter);
        emit LandRegistered(landCounter, msg.sender);
    }

    function transferLand(uint256 _landId, address _to) external onlyOwner(_landId) {
        Land storage land = lands[_landId];
        require(land.isRegistered, "Land not registered");
        
        // Update ownership
        address[] storage currentOwners = land.owners;
        for(uint i = 0; i < currentOwners.length; i++) {
            if(currentOwners[i] == msg.sender) {
                currentOwners[i] = _to;
                break;
            }
        }

        // Update history
        landHistory[_landId].previousOwners.push(_to);
        landHistory[_landId].transferDates.push(block.timestamp);

        // Update owner mapping
        ownerToLands[_to].push(_landId);
        
        // Remove from old owner's list
        uint256[] storage fromLands = ownerToLands[msg.sender];
        for (uint256 i = 0; i < fromLands.length; i++) {
            if (fromLands[i] == _landId) {
                fromLands[i] = fromLands[fromLands.length - 1];
                fromLands.pop();
                break;
            }
        }

        emit OwnershipTransferred(_landId, msg.sender, _to);
    }

    function updateValuation(uint256 _landId, uint256 _newValuation) external onlyOwner(_landId) {
        lands[_landId].valuation = _newValuation;
        emit LandValuationUpdated(_landId, _newValuation);
    }

    function setForSale(uint256 _landId, uint256 _price) external onlyOwner(_landId) {
        Land storage land = lands[_landId];
        land.isForSale = true;
        land.price = _price;
        land.status = "For Sale";
        emit LandStatusChanged(_landId, "For Sale");
    }

    function addDocument(uint256 _landId, string memory _documentHash) external onlyOwner(_landId) {
        lands[_landId].documents.push(_documentHash);
        emit DocumentAdded(_landId, _documentHash);
    }

    function verifyLand(uint256 _landId) external onlyVerifier {
        Land storage land = lands[_landId];
        require(!land.isVerified, "Land already verified");
        land.isVerified = true;
        land.verifiedBy = msg.sender;
        land.verificationDate = block.timestamp;
        emit LandVerified(_landId, msg.sender);
    }

    function raiseDispute(uint256 _landId, string memory _reason) external {
        require(lands[_landId].isRegistered, "Land not registered");
        landDisputes[_landId].push(Dispute({
            landId: _landId,
            complainant: msg.sender,
            reason: _reason,
            isResolved: false,
            resolution: "",
            resolvedBy: address(0),
            resolutionDate: 0
        }));
        emit DisputeRaised(_landId, msg.sender);
    }

    function resolveDispute(uint256 _landId, uint256 _disputeIndex, string memory _resolution) external onlyVerifier {
        require(_disputeIndex < landDisputes[_landId].length, "Invalid dispute index");
        Dispute storage dispute = landDisputes[_landId][_disputeIndex];
        require(!dispute.isResolved, "Dispute already resolved");
        
        dispute.isResolved = true;
        dispute.resolution = _resolution;
        dispute.resolvedBy = msg.sender;
        dispute.resolutionDate = block.timestamp;
        
        emit DisputeResolved(_landId, msg.sender);
    }

    function getMyLands() external view returns (uint256[] memory) {
        return ownerToLands[msg.sender];
    }

    function getLandDetails(uint256 _landId) external view returns (
        uint256 id,
        string memory location,
        uint256 area,
        address[] memory owners,
        bool isRegistered,
        uint256 valuation,
        bool isForSale,
        uint256 price,
        string memory status,
        string[] memory documents,
        bool isVerified,
        address verifiedBy,
        uint256 verificationDate
    ) {
        Land memory land = _getLand(_landId);
        return (
            land.id,
            land.location,
            land.area,
            land.owners,
            land.isRegistered,
            land.valuation,
            land.isForSale,
            land.price,
            land.status,
            land.documents,
            land.isVerified,
            land.verifiedBy,
            land.verificationDate
        );
    }

    function getLandHistory(uint256 _landId) external view returns (
        address[] memory previousOwners,
        uint256[] memory transferDates
    ) {
        OwnershipHistory storage history = landHistory[_landId];
        return (history.previousOwners, history.transferDates);
    }

    function getLandDisputes(uint256 _landId) external view returns (Dispute[] memory) {
        return landDisputes[_landId];
    }

    function removeDocument(uint256 _landId, string memory _documentHash) external onlyOwner(_landId) {
        Land storage land = lands[_landId];
        require(land.isRegistered, "Land not registered");
        
        // Find and remove the document
        string[] storage documents = land.documents;
        bool found = false;
        uint256 indexToRemove;
        
        for(uint256 i = 0; i < documents.length; i++) {
            if(keccak256(bytes(documents[i])) == keccak256(bytes(_documentHash))) {
                found = true;
                indexToRemove = i;
                break;
            }
        }
        
        require(found, "Document not found");
        
        // Remove the document by shifting elements
        for(uint256 i = indexToRemove; i < documents.length - 1; i++) {
            documents[i] = documents[i + 1];
        }
        documents.pop();
        
        emit DocumentRemoved(_landId, _documentHash);
    }

    function revertSaleStatus(uint256 _landId) external onlyOwner(_landId) {
        Land storage land = lands[_landId];
        require(land.isRegistered, "Land not registered");
        require(land.isForSale, "Land is not for sale");
        
        land.isForSale = false;
        land.price = 0;
        land.status = "Registered";
        
        emit SaleStatusReverted(_landId);
    }
}
